import React from "react"

function App() {
  let iceCreamFlavors
  fetch("/api/flavors/all")
    .then(response => response.json())
    .then(data => {
      let iceCreamFlavors = data
    })
  console.log(iceCreamFlavors)
  return <h1 align="center">Hey</h1>
}

export default App;
